import React from 'react';
import { OuterWrapper, InnerWrapperFooter, P, H2 } from 'styles/MainStyles';
import { Link } from 'react-router-dom';

const Footer = () => {

    return (
    <OuterWrapper>
        <InnerWrapperFooter>
        <H2>NEWS LETTER</H2>
        <P>Would you like to receive our newsletter?</P>
        <label htmlFor='new-message'>
            <input
                type="input"
            //   onChange={onSetNameChange}
            //   value={newName}
              id='new-message'
              name='new-message'
              placeholder='Name'
              />
        </label>    
        <P>LINKS</P>
        <P>Book a room</P>
        </InnerWrapperFooter>
    </OuterWrapper>
    )
}

export default Footer;
